export default function Search() {
  return (
    <div {...getComboboxProps()}>
      <input
        {...getInputProps({
          type: "search",
          placeholder: "Search for an user",
          id: "search",
          className: loading ? "loading" : "",
        })}
      />
    </div>
  );
}
